import React from 'react';

const TodoList: React.FC = props => {
  const todos = [{id: 't1', text: 'Finish the course'}];

  return (
    <ul>
      {todos.map((todo) => {
        return (
          <li key={todo.id}>{todo.text}</li>
        );
      })}
    </ul>
  );
}

export default TodoList;
